.navbar-custom {
	position: sticky;
	width: 100%;
	top: -1px;
	z-index: 99;
}
.navbar-custom-menu {
	display: flex !important;
	justify-content: space-between;
	align-items: center;
}
.navbar-custom-menu .title {
	margin-bottom: 0px;
}
.hidden {
	display: none;
}
.w-100{
	max-width: 230px;
	min-width: 230px;
}
.navbar.is-role{
	background-color: #DC1A5B !important;
	box-shadow: none;
	border-radius: 0;
}
img.icono{
